ay to work together again--which is easier said than done, even when they','Incredibles 2','','publish','open','closed','','incredibles-2','','','2018-07-14 08:32:38','2018-07-14 08:32:38','',0,'http://localhost:8008/filmer-wp/?post_type=film&#038;p=63',0,'film','',0),(64,1,'2018-07-14 08:27:35','2018-07-14 08:27:35','','v1.bTsxMjcxMzEzMTtqOzE3Nzg3OzEyMDA7MTA4NjsxNjA5','','inherit','open','closed','','v1-btsxmjcxmzezmttqoze3nzg3ozeymda7mta4njsxnja5','','','2018-07-14 08:27:35','2018-07-14 08:27:35','',63,'http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bTsxMjcxMzEzMTtqOzE3Nzg3OzEyMDA7MTA4NjsxNjA5.jpg',0,'attachment','image/jpeg',0),(65,1,'2018-07-14 08:32:19','2018-07-14 08:32:19','','v1.bjsxOTYyMjA1O2o7MTc3OTc7MTIwMDs0MDk2OzE4NjI','','inherit','open','closed','','v1-bjsxotyymja1o2o7mtc3otc7mtiwmds0mdk2oze4nji','','','2018-07-14 08:32:19','2018-07-14 08:32:19','',63,'http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxOTYyMjA1O2o7MTc3OTc7MTIwMDs0MDk2OzE4NjI.jpg',0,'attachment','image/jpeg',0),(66,1,'2018-07-14 08:41:45','2018-07-14 08:41:45','<img class=\" wp-image-67 aligncenter\" src=\"http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxODgwODkzO2o7MTc3OTY7MTIwMDs1MDU0OzE5NjI-300x118.jpg\" alt=\"\" width=\"447\" height=\"176\" />\r\n<div id=\"movieSynopsis\" class=\"movie_synopsis clamp clamp-6\">In an alternate present-day version of Oakland, black telemarketer Cassius Green (Lakeith Stanfield) discovers a magical key to professional success, which propels him into a macabre universe of \"powercalling\" that leads to material glory. But the upswing in Cassius\' career raises serious red flags with his girlfriend Detroit (Tessa Thompson), a performance artist and minimum-wage striver who\'s secretly part of a Banksy-style activist collective. As his friends and co-workers organize in protest of corporate oppression, Cassius falls under the spell of his company\'s cocaine-snorting CEO Steve Lift (Armie Hammer), who offers him a salary beyond his wildest dreams.</div>','Sorry to Bother You','','publish','open','closed','','sorry-to-bother-you','','','2018-07-14 08:41:45','2018-07-14 08:41:45','',0,'http://localhost:8008/filmer-wp/?post_type=film&#038;p=66',0,'film','',0),(67,1,'2018-07-14 08:37:23','2018-07-14 08:37:23','','v1.bjsxODgwODkzO2o7MTc3OTY7MTIwMDs1MDU0OzE5NjI','','inherit','open','closed','','v1-bjsxodgwodkzo2o7mtc3oty7mtiwmds1mdu0oze5nji','','','2018-07-14 08:37:23','2018-07-14 08:37:23','',66,'http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxODgwODkzO2o7MTc3OTY7MTIwMDs1MDU0OzE5NjI.jpg',0,'attachment','image/jpeg',0),(68,1,'2018-07-14 08:37:24','2018-07-14 08:37:24','','v1.bTsxMjc0NDcyNztqOzE3Nzg3OzEyMDA7NDA0OzU5OA','','inherit','open','closed','','v1-btsxmjc0ndcynztqoze3nzg3ozeymda7nda0ozu5oa','','','2018-07-14 08:37:24','2018-07-14 08:37:24','',66,'http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bTsxMjc0NDcyNztqOzE3Nzg3OzEyMDA7NDA0OzU5OA.jpg',0,'attachment','image/jpeg',0),(69,1,'2018-07-14 08:46:25','2018-07-14 08:46:25','<img class=\" wp-image-70 aligncenter\" src=\"http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxODQ4OTAxO2o7MTc3OTY7MTIwMDs0Mjk2OzE5MTY-300x118.jpg\" alt=\"\" width=\"440\" height=\"173\" />\r\n<div id=\"movieSynopsis\" class=\"movie_synopsis clamp clamp-6 unclamp\">Board the Millennium Falcon and journey to a galaxy far, far away in Solo: A Star Wars Story, an all-new adventure with the most beloved scoundrel in the galaxy. Through a series of daring escapades deep within a dark and dangerous criminal underworld, Han Solo meets his mighty future copilot Chewbacca and encounters the notorious gambler Lando Calrissian, in a journey that will set the course of one of the Star Wars saga\'s most unlikely heroes.</div>','Solo: A Star Wars Story','','publish','open','closed','','solo-a-star-wars-story','','','2018-07-14 08:46:25','2018-07-14 08:46:25','',0,'http://localhost:8008/filmer-wp/?post_type=film&#038;p=6