1O2o7MTc3OTc7MTIwMDs0MTY3OzI3ODM','','inherit','open','closed','','v1-bjsxotcxnty1o2o7mtc3otc7mtiwmds0mty3ozi3odm','','','2018-07-14 08:50:28','2018-07-14 08:50:28','',72,'http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxOTcxNTY1O2o7MTc3OTc7MTIwMDs0MTY3OzI3ODM.jpg',0,'attachment','image/jpeg',0),(75,1,'2018-07-14 08:55:12','2018-07-14 08:55:12','<img class=\" wp-image-76 aligncenter\" src=\"http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxOTA3ODQ4O2o7MTc3OTc7MTIwMDs0NTAwOzE4ODI-300x118.jpg\" alt=\"\" width=\"440\" height=\"173\" />\r\n<div id=\"movieSynopsis\" class=\"movie_synopsis clamp clamp-6 unclamp\">Starring Shailene Woodley (Fault in Our Stars, Divergent films) and Sam Claflin (Me Before You, The Hunger Games films), ADRIFT is based on the inspiring true story of two sailors who set out to journey across the ocean from Tahiti to San Diego. Tami Oldham (Woodley) and Richard Sharp (Claflin) couldn\'t anticipate they would be sailing directly into one of the most catastrophic hurricanes in recorded history. In the aftermath of the storm, Tami awakens to find Richard badly injured and their boat in ruins. With no hope for rescue, Tami must find the strength and determination to save herself and the only man she has ever loved. ADRIFT is the unforgettable story about the resilience of the human spirit and the transcendent power of love.</div>','Adrift','','publish','open','closed','','adrift','','','2018-07-14 08:55:12','2018-07-14 08:55:12','',0,'http://localhost:8008/filmer-wp/?post_type=film&#038;p=75',0,'film','',0),(76,1,'2018-07-14 08:53:22','2018-07-14 08:53:22','','v1.bjsxOTA3ODQ4O2o7MTc3OTc7MTIwMDs0NTAwOzE4ODI','','inherit','open','closed','','v1-bjsxota3odq4o2o7mtc3otc7mtiwmds0ntawoze4odi','','','2018-07-14 08:53:22','2018-07-14 08:53:22','',75,'http://localhost:8008/filmer-wp/wp-content/uploads/2018/07/v1.bjsxOTA3ODQ4O2o7MTc3OTc7MTIwMDs0NTAwOzE4ODI.jpg',0,'attachment','image/jpeg',0),(77,1,'2018-07-14 08:53:23','2018-0